import React from "react";
import PropTypes from "prop-types";
import './Album.css'

function Albums({ id, title }) {
	return (
		<div className="album">
			<img src="https://images.saymedia-content.com/.image/t_share/MTc0NDkxNzgyMzYzNDg5NjQw/vinyl-to-paper-how-to-write-an-album-review.jpg" alt='album'/>
			<div className="album_data">
				<h4 className="album_id">{"no." + id}</h4>
				<h3>Title</h3>
				<h2 className="album_title">{title}</h2>
			</div>
		</div>
	);
}

Albums.prototype = {
	id: PropTypes.number.isRequired,
	title: PropTypes.string.isRequired,
	userId: PropTypes.number,
};

export default Albums;
